values:
I am typing this at... 5:43 AM, I couldn't sleep last night, so I got up,a nd watched about four movies. Scool of Rock, 100 Women, Ju-On, and Ghoulies... ._. -Sighs some.- I feel sick, and I cannot stop shaking, if I puke when people are up this morning, I probably won't be going to school.. Yeah, I don't sleep much, I know, and it makes me sick.. literally. It's probably why I get migranes. And probably why I get so irritable... <-<;; Ahem yeah...

Ryan started an account on Live Journal. ^_^ -Clings to him.- Teehee... You better post.. <_< Or I'll bite y-- <_< No, you might enjoy that, I'll...-Rubs temples.- Headache.. anyway.. I'll kick yer ass. =]

Yes, I'm going to go take a shower, and hopefully not puke up what's in my stomach, which I think I'm gonna do here soon, considering I can taste dinner, which was at 6 something yesterday evening... Arg... I need my sleeping pills, why did my doctor have to cancel them? Narrrr.. @_@ C-Sama.. help me.. -Collapses on her.- I feel weak, not tired, but weak... And I feel sick, and I'm ranting.. I know it..

Ooo.. -Shiver.- Cold chills, I wonder where those came from, and I have to sneeze? ... -AACHI!- x_X;; Brb, Lisa needs cereal, and lets ALL hope I don't puke it up, kay? Okay, I changed my mind on the cereal, it is now ten until six in the morning.. Lisa what the hell are writing a journal entry at this time of day for? ... I'm bored, feel sick, and need something to do?

Hn, what's happened to me in the past couple of days.. <_< Went to Wake, as usual... got pictures taken, got my own page on one of the Wake the Dead gallaries.. I went looking for the link, I can't find it at the moment, so I'll give you people this one instead. http://leoktopous.net/wakethedead/index.html I'm on a page called.. Lisa's page. =/ Uhm what else did I do? ... I can't honestly remember right now, my brain is like.. BLAHHH.. LISA GIVE ME SLEEP, OR I'LL MAKE IT HARD FOR YOU TO THINK AND FUNCTION TODAY IN SCHOOL.. and I'm all... Blahhhh -Drools on self.- >__>;;; ... And then my brain.. LISA, I NEED SLEEP, GIVE IT TO ME NOW... -MAKES HER DROOL MORE- Lisa: =]~~~~~~~~~~~~~~~~ -DROOOOOOOOOOOOOOOOOOOOOOOOL.- Nani? ^_____^;;; -Smiles foolishly.- Brain: I give up on you woman... Lisa: -Drooool.- xDDD;;; 

I need help, yes I do. And I also need a garbage can, excuse me while I lean my head over and wait for puke... Or not.. >_> I swore I would have puked then.. -Shrugs some and glances down at the plushies in her lap.- XD You know what's fucking... weird for me? I was watching Ju-On, alone.. in the dark... in a basement.. <__< And.. I got scared at one point in the movie, and was all, "OH MY GOD NO!!'' -Closes her eyes, hides under blanket, clings to plushies for dear fucking life.- <_____< Then I would peek just one eye out from under the blanket at some points. XD I'm so babyish.. I hate that sound. ;-; ... Ehhhahhhhaehhhehehehehehhhh.. that one... -Burps.- Ew, tasted like.. like... A burp. <_<; 

It's 6:02, and I'm so fucking clueless. -Drools.- ^_^ I have no idea what I'm gonna wear.. -Drooool, drool.- So excuse me whilst I rummage through my.... While I go through my clothes? -Couldn't word it right the first time.- <__<;;; For the nosey people: My "Leave Me Alone!" Shirt, blue jeans with Anarchy symbol on my high, studded belt, and black zip up hoodie, and black converse of course... Hey, where did I put my glasses. oo;;

Okay, I found them.. oo; -Clings to her Ryan, who is probably on his way to school at the moment.- >_>! ZOMG.. I talked to Tony last night. =] I've missed the little fucker... -Goes all Tony like, does the heel toe.- Wurd, dawg. oo;;; Nah, he doesn't talk like that, but he is a wigger, he admits to it. XD C-Sama's brother calls him... SexyWigger or something like that.. <_< I dun know. 

Yah, I'm gonna go now, take a shower and such, I smell like cigarettes. -_-; Damn it dad... Oh, no, I'ma change my shirt.. maybe... grey dress shirt with my tie, I dunno, depends on how I feel when I get out of the shower, so.. g'bye! o.o;;

Lisa <3

I are in science at the moment. Tis 10:23 am. =l Doing some retarded ISAT test thing. -_-; Ia re sitting next to Megan too. o.o; I have his purity, oh yeah. XD! Hahaha, we got a 57% on our ISAT test practice thing, I just guessed on half of them, because we haven't even started on those subjects. o.o; Some of them I knew, but yeah, some of them I didn't, so I just kept on guessing.=o We have five minutes left in class y0.

Last night was su fun. o___o;;;; -Giggles insanely.- Teehehehehehehee... o___o -Waves the purity around in a bottle.- I'll stop now. >__>;;; -Plops down on the ground and smiles, putting her hands in her lap and humming contently.- Hn hn hnnnn...... -Adjusts glass, before pushing them up her nose.- Neener. o_o; I like my glasses, yes I do. They are yummy, and make it so I can see. O_O When I first got them, I was all..., "DADDEH OH MY GOD!! I CAN SEEEEEE!!!!!'' -Wheeze.- o_o;;; 

I have two minutes left. <_< -Cough, hack wheeze.- x_X; -Burps.- n.n -Giggle.- I am in a good mood, woooot. o_o Danke sehr Ryan, you have put the once mellow and depressed Lisa into a giggly and happy mood. I thank you. SANKYU O_O -HUG.- <__<;;;

Yes, one minute left, and I'm a freak, I know. Y0, bite my butt. o.o;;; AHH BELL!!! -SENDS TO SELF, FUGGEN RUNS!!-

Okey uh, for starters. Fuck off, all of you. n_n; 

Sorreh, ahem. Woke up...kicked a chair on accident, got yelled at to the point of tears, got hit.. uhn..slit my wrists.. uhm.... going to my aunt's for a week or two, uhn, then most likely the hospital. Err... I hate life. n_n I wanna die, my dad needs to fucking lay off of me... Uhm.... I'm miserable, and very suicidal at the moment. Uhmmm.... What else... I. Hate. My. Life. Yeah, that's about it. n_n; Good bye!..

I'll explain more when I get back. n_n... Nnn, just keep smiling Lisa... nnnnn n__n;;;;;;;;;;

Lisa
